import React from "react";
import ToDo from './components/ToDo';
const urlToDo ='https://jsonplaceholder.typicode.com/todos'

class App extends React.Component{
  constructor(){
    super();

    this.state = {
      todos: [
        {id: 0, title: 'CreateApp', done: false},
        {id: 1, title: 'CreateApp', done: true},
        {id: 2, title: 'CreateApp', done: false}]
    };
  }

  render(){
    const { todos } = this.state;

    return <div className="App">
      <h1 className="top">Actice tasks: {tasks.length}</h1>

     {todos.map(task =>(<ToDo task={task} key={task.id}></ToDo>
       )) 
     }
    </div>
  }
}

export default App;
